import React from 'react';
import DeliveryTruck from './Images/delivery-truck.svg';
import './Delivery.css';

const Delivery = () => {
    return (<>
        <main>
            <div className="container-fluid d-flex justify-content-center align-items-center" id="deliveryMain">
                <div className="pt-3" id="deliveryMainContainer">
                    <div className="row">
                        <div className="col-md-12 col-6 order-md-1 order-2 text-center">
                            <img src={DeliveryTruck} alt="Delivery-Truck" />
                        </div>
                        <div className="col-md-12 col-6 order-md-2 order-1 text-center"></div>
                    </div>
                </div>
            </div>
        </main>
    </>);
}

export default Delivery;
